(function () {
  if (jQuery && jQuery.fn && jQuery.fn.select2 && jQuery.fn.select2.amd) {
    var e = jQuery.fn.select2.amd;

    e.define("select2/i18n/eu", [], function () {
      // Basque language translations for Select2
      return {
        inputTooLong: function (e) {
          var t = e.input.length - e.maximum;
          var message = "Idatzi ";
          message += 1 == t ? "karaktere bat" : t + " karaktere";
          message += " gutxiago";
          return message;
        },
        inputTooShort: function (e) {
          var t = e.minimum - e.input.length;
          var message = "Idatzi ";
          message += 1 == t ? "karaktere bat" : t + " karaktere";
          message += " gehiago";
          return message;
        },
        loadingMore: function () {
          return "Emaitza gehiago kargatzen…";
        },
        maximumSelected: function (e) {
          var message = 1 === e.maximum ? "Elementu bakarra hauta dezakezu" : e.maximum + " elementu hauta ditzakezu soilik";
          return message;
        },
        noResults: function () {
          return "Ez da bat datorrenik aurkitu";
        },
        searching: function () {
          return "Bilatzen…";
        },
        removeAllItems: function () {
          return "Kendu elementu guztiak";
        }
      };
    });

    e.define, e.require;
  }
})();
